-- ----------------------------
-- Table structure for hsw_fault_info
-- ----------------------------
DROP TABLE IF EXISTS `hsw_fault_info`;
CREATE TABLE `hsw_fault_info`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `fault_no` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '故障编号，以日期时间格式化的字符串date(\"YmdHis\",time())',
  `region_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '视点位置',
  `ip` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0.0.0.0' COMMENT '视点IP',
  `sn` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '逻辑地址32位',
  `port` int(8) NULL DEFAULT NULL COMMENT '端口号，非摄像机故障为0',
  `type` char(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '故障类型',
  `take_time` bigint(10) NOT NULL COMMENT '发生时间',
  `pid` bigint(20) NOT NULL COMMENT '所属项目',
  `descr` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '故障描述',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '故障状态（0=未派单；1=待接单；2=在修； 3=已修复；4=挂起; 5=自动修复; 6=已撤单）',
  `flag_status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '归档状态（0=活动故障；1=历史故障；）',
  `repair_time` bigint(10) NOT NULL COMMENT '修复时间',
  `job_id` bigint(20) NOT NULL COMMENT '对应工单id，',
  `job_no` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '对应工单编号',
  `mt_id` bigint(20) NULL DEFAULT NULL COMMENT '维修队id',
  `area` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '来源于设备对应分工区域名称（乡镇/街道/小区），便于查询',
  `mu_id` bigint(20) NULL DEFAULT NULL COMMENT '运维单位id',
  `today_take_count` int(11) NULL DEFAULT NULL COMMENT '仅对摄像机故障有效，一天该摄像机发生的第几次故障',
  `divide_work_id` bigint(20) NULL DEFAULT NULL COMMENT '故障所属分工区域id',
  `op_state` char(8) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '操作状态(0=派单；1=接单；2=拒绝；3=申请改派；4=改派；5=申请挂起；6=挂起；7=撤回挂起；8=撤销；9=结单；10=拒绝挂起；11=拒绝改派)',
  `zigzag_count` int(8) NULL DEFAULT NULL COMMENT '颠簸次数',
  `influence_camera_count` int(8) NULL DEFAULT NULL COMMENT '影响摄像机数量',
  `zigzag_type` int(8) NULL DEFAULT NULL COMMENT '颠簸故障类型（同故障状态，除工作不稳定2种）',
  `zigzag_status` int(8) NULL DEFAULT NULL COMMENT '颠簸状态（0=未处理；1=已处理）',
  `timeout_level` int(11) NULL DEFAULT NULL,
  `start_distance` int(8) NULL DEFAULT NULL,
  `end_distance` int(8) NULL DEFAULT NULL,
  `timeout_hour` int(8) NULL DEFAULT NULL,
  `device_distance` int(8) NULL DEFAULT NULL,
  `send_work_order_limit` double(8, 1) NULL DEFAULT NULL,
  `network` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '网络运营商',
  `del_flag` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '创建者',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '更新者',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 84 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '故障信息' ROW_FORMAT = Dynamic;

